import java.util.*;


class Solution {
    void moveRow(char[][] boxGrid, int cn, int rowIdx) {
        int i, j, cnt = 0;
        for (i = 0; i < cn; i++) {
            if (boxGrid[rowIdx][i] == '#') {
                cnt++;
                boxGrid[rowIdx][i] = '.';
            }
            if (boxGrid[rowIdx][i] == '*' || i == cn - 1) {
                j = boxGrid[rowIdx][i] == '*' ? i - 1 : i;
                while (cnt > 0) {
                    boxGrid[rowIdx][j] = '#';
                    cnt--;
                    j--;
                }
            }
        }
    }
    char[][] rotate(char[][] boxGrid, int rn, int cn) {
        int i, j;
        char[][] res = new char[cn][rn];
        for (i = 0; i < rn; i++) {
            for (j = 0; j < cn; j++) {
                res[j][rn - i - 1] = boxGrid[i][j];
            }
        }
        return res;
    }
    public char[][] rotateTheBox(char[][] boxGrid) {
        int rn = boxGrid.length, cn = boxGrid[0].length, i;
        for (i = 0; i < rn; i++) {
            moveRow(boxGrid, cn, i);
        }
        char[][] res = rotate(boxGrid, rn, cn);
        return res;
    }
}
